import React from 'react';
// import CssBaseline from '@material-ui/core/CssBaseline';
import Navbar from '../navbar/navbar';
import About from '../content/About';
import Particles from 'react-particles-js';
import './App.css';

const App = () => {
  return (
    <>
      {/* <CssBaseline/> */}
      <Particles
      params={{
        particles: {
          number:{
            value: 45
          }
        }
      }
    }
      />  
      <Navbar/>
      <About/>
    </>
  );
}

export default App;
